css:
.atom-text-editor,
atom-text-editor {
  color: #787d9b;
  background: #1e2029;
}
.atom-text-editor .invisible-character,
atom-text-editor .invisible-character,
.atom-text-editor .indent-guide,
atom-text-editor .indent-guide {
  color: rgba(120, 125, 155, 0.2);
}
.atom-text-editor .gutter,
atom-text-editor .gutter {
  background-color: #212121;
}
.atom-text-editor .gutter .line-number,
atom-text-editor .gutter .line-number {
  opacity: 0.5;
}
.atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number.folded,
.atom-text-editor .gutter .line-number::after,
atom-text-editor .gutter .line-number::after,
.atom-text-editor .fold-marker::after,
atom-text-editor .fold-marker::after {
  color: #d33682;
}
.atom-text-editor .selection .region,
atom-text-editor .selection .region {
  background-color: rgba(230, 42, 25, 0.3);
}
.atom-text-editor .highlights .current-result .region,
atom-text-editor .highlights .current-result .region {
  background-color: rgba(97, 175, 239, 0.6);
}
.atom-text-editor .highlights .find-result .region,
atom-text-editor .highlights .find-result .region {
  border-bottom: 1px dotted rgba(97, 175, 239, 0.9) !important;
}
.atom-text-editor .line-number.cursor-line-no-selection,
atom-text-editor .line-number.cursor-line-no-selection {
  background-color: #303241;
}
.bracket-matcher .region {
  background-color: #c2cbff;
  opacity: 0.2;
}
.syntax--comment {
  color: rgba(171, 179, 186, 0.5);
}
.syntax--entity {
  color: #F92672;
}
.syntax--keyword {
  font-weight: bold;
  color: #F92672;
}
.syntax--storage {
  color: #66D9EF;
}
.syntax--storage.syntax--type,
.syntax--support.syntax--type.syntax--stdint,
.syntax--support.syntax--type.syntax--sys-types {
  color: #43d08a;
}
.syntax--support.syntax--function.syntax--any-method,
.syntax--support.syntax--function.syntax--C99 {
  color: #B0EC38;
}
.syntax--support.syntax--type.syntax--exception {
  color: #FD971F;
}
.syntax--constant {
  color: #AE81FF;
}
.syntax--constant.syntax--numeric,
.syntax--constant.syntax--boolean {
  color: #AE81FF;
}
.syntax--variable {
  color: #FD971F;
}
.syntax--delimiter,
.syntax--brace {
  color: #abb3ba;
}
.syntax--invalid.syntax--deprecated {
  color: #e62a19;
  text-decoration: underline;
}
.syntax--invalid.syntax--illegal {
  color: #e62a19;
}
.syntax--string {
  color: #E6DB74;
}
.syntax--string .syntax--constant.syntax--character.syntax--escape {
  color: #e62a19;
}
.syntax--string.syntax--regexp {
  color: #56b6c2;
}
.syntax--string.syntax--regexp .syntax--source.syntax--ruby.syntax--embedded,
.syntax--string.syntax--regexp .syntax--string.syntax--regexp.syntax--arbitrary-repitition {
  color: #e62a19;
}
.markdown-preview atom-text-editor {
  color: #e3e6e8;
  background-color: #262626;
}
.syntax--markup.syntax--heading {
  font-weight: bold;
}
.syntax--markup.syntax--marker {
  color: #F92672;
}
.syntax--markup.syntax--link {
  color: #586E75;
}
.syntax--markup.syntax--raw {
  color: #56b6c2;
}
